import React, { Component } from 'react'; 
import './index.css';

export default class DailyGoalDisplay extends Component {
    render() {
        return(
            <div>
                <section>
                    <h1>Today's Goal </h1>
                    <hr aria-hidden="true"/>
                    <p>{this.props.goal}</p>

                </section>
            </div>
        )
    }
}
